const Movies = () => {
    return ( 
        <div className="movies">
            <h1>{Title}</h1>
            <h2>{Genre}</h2>
            <h2>{Rated}</h2>
            <h2>{Director}</h2>
            <h2>{Plot}</h2>
        </div>

     );
}
 
export default Movies;
